  return (
    <section
      className="mt-25 mb-10 ml-5 mr-5"
      style={{ display: "flex", flexDirection: "column", gap: "10px" }}
    >
      <ul style={{listStyleType: "none"}}>
        <li>
          <ConstructorElement
            type="top"
            isLocked={true}
            text="Краторная булка N-200i (верх)"
            price={200}
            thumbnail={data[0].image}
          />
        </li>
        <li>
          <ConstructorElement
            type="top"
            isLocked={true}
            text="Краторная булка N-200i (верх)"
            price={200}
            thumbnail={data[0].image}
          />
        </li>
        <li>
          <ConstructorElement
            type="top"
            isLocked={true}
            text="Краторная булка N-200i (верх)"
            price={200}
            thumbnail={data[0].image}
          />
        </li>
      </ul>
    </section>
  );
}

export default BurgerConstructor;
